    [],nt"revision_timestamp": "2016-03-28T18:44:34.454303",nt"name": "noaa-form-370-database",nt"isopen":
    false,nt"url": null,nt"notes": "The data set contains information from
    submitted NOAA Form 370s, also known as the Fisheries Certificate of Origin, for
    imported shipments of frozen and/or processed tuna and for certain non-tuna fishery
    products where as determined by the High Seas Driftnet Fisheries Enforcement Act.
     Data are available from May 2001 to present with new data appended weekly. Data
    elements include the Customs and Border Protection (CBP) entry number, CBP entry
    date, HTS code, flag of catcher vessel, ocean area, gear type, and trip dates, and
    dolphin safe status.  Non summarized data are considered confidential.n",nt"license_title":
